import React, { Component } from 'react';
import jwt_decode from 'jwt-decode'
import { Link } from 'react-router-dom';
import axios from "axios"


export default class EventEdit extends Component {

    constructor(props) {
        super(props);
        this.onChangeRid = this.onChangeRid.bind(this)
        this.onChangeTitle = this.onChangeTitle.bind(this)
        this.onChangeDate = this.onChangeDate.bind(this)
        this.onChangeStart = this.onChangeStart.bind(this)
        this.onChangeEnd = this.onChangeEnd.bind(this)
        this.onChangeDescription = this.onChangeDescription.bind(this)
        this.onChangePicture = this.onChangePicture.bind(this)
        this.onSubmit = this.onSubmit.bind(this)

        this.state = {
            rid: '',
            event_title: '',
            event_date: '',
            start_time: '',
            end_time: '',
            description: '',
            event_picture: ''
        }

    }

    componentDidMount() {

        axios.get('http://localhost:5000/restaurants/events/event/' + this.props.match.params.id)
            .then(response => {
                this.setState({
                    rid: response.data.rid,
                    event_title: response.data.event_title,
                    event_date: response.data.event_date,
                    start_time: response.data.start_time,
                    end_time: response.data.end_time,
                    description: response.data.description,
                    event_picture: response.data.event_picture
                })
            })
    }

    render() {
        return (
            <div>s</div>
        )
    }
}
